import React from 'react';
import DropzoneEn from '../Dropzone/dropzoneEn';
import DropzoneZn from '../Dropzone/dropzoneZn';

import '../assets/css/layout.css';
import Editor1 from '../components/editor/editor1';

const AddBenner = () => {
  return (
    <>
      <div className="bner-drpzon">
        <div className="sub-name">Representative image registration</div>
        <div>
          <DropzoneEn />
        </div>
        <div className="sub-name">代表图像注册</div>
        <div>
          <DropzoneZn />
        </div>
        <div className="sub-name">Representative image registration</div>
        <div className="te">
          <Editor1 />
        </div>
        <div className="sub-name">代表图像注册</div>
        <div>
          <Editor1 />
        </div>
        <div>
          <button className="cancel-btn">취소</button>
          &nbsp; &nbsp;
          <button className="edit-button">확인</button>
        </div>
      </div>
    </>
  );
};

export default AddBenner;
